import React,{Component} from 'react';
// import './Shirt.css'
class Products extends Component{
    render(){
        var {match}=this.props;
        var name=match.path;
        return(
            <div className="shirt">
                <pre className="color-darkgray">HOME  <i class="fas fa-arrow-right color-black"></i> <b className="color-black"> {this.props.ten}</b></pre>
                <a href="http://localhost:4000/anh/12" class="MagicZoom" id="trainer"  data-options="zoomPosition: inner"><img src="http://localhost:4000/anh/12be"></img></a>
                <a data-zoom-id="trainer" href="http://localhost:4000/anh/12be" data-image="http://localhost:4000/anh/12be"><img src="http://localhost:4000/anh/12tiny"></img></a>
                <a data-zoom-id="trainer" href="http://localhost:4000/anh/12be" data-image="http://localhost:4000/anh/12be"><img src="http://localhost:4000/anh/12tiny"></img></a>
                <a data-zoom-id="trainer" href="http://localhost:4000/anh/12be" data-image="http://localhost:4000/anh/12be"><img src="http://localhost:4000/anh/12tiny"></img></a>
            </div>
        )
}}
export default Products
